        <Avatar alt="Cindy Baker">CB</Avatar>
        
        </ListItemAvatar>
        <ListItemText
           style={colorlistitem}
          primary="Oui Oui"
          secondary={
            <React.Fragment>
              <Typography
                component="span"
                variant="body2"
                style={inline}
                color="textPrimary"
              >
                Sandra Adams
              </Typography>
              {' — Do you have Paris recommendations? Have you ever…'}
            </React.Fragment>
          }
        />
      </ListItem>

